INSERT INTO `blogs` (`id`, `user_id`, `title`, `intro`, `details`, `created_at`, `updated_at`, `deleted_at`) VALUES
	(1, 1, 'Top 8 New Technology Trends for 2020', 'Technology is now evolving at such a rapid pace that annual predictions of trends can seem out-of-date before they even go live as a published blog post or article. As technology evolves, it enables even faster change and progress, causing an acceleration of the rate of change, until eventually, it will become exponential. ', 'Technology-based careers don’t change at the same speed, but they do evolve, and the savvy IT professional recognizes that his or her role will not stay the same. And an IT worker of the 21st century will constantly be learning (out of necessity if not desire). What does this mean for you? It means staying current with technology trends. And it means keeping your eyes on the future, to know which skills you’ll need to know and what types of jobs you want to be qualified to do. Here are eight technology trends you should watch for in 2020, and some of the jobs that will be created by these trends.', '2020-08-23 01:17:44', NULL, NULL),
	(2, 1, 'asdfsdafasdfasdfasd', 'sdafadwfasfasdfasf', 'asfasdfasfasdf asd asdsdf asdfasd fsd asdf asdfasdf sd asdfasd asd fasd fas', '2020-08-23 05:12:35', NULL, NULL),
	(3, 1, 'dasdasd', 'asdasds', 'dasd  asd as asd asd sad as', '2020-08-23 05:25:37', NULL, NULL),
	(4, 1, 'The Next Billion-Dollar Athlete: Lionel Messi Closes In', 'After a disappointing season, the soccer superstar is eyeing the exit at Barcelona, but he still is on pace to reach t', 'It’s the kind of free-market economics that until this year were the domain of independent contractors. Tiger Woods was the first athlete to earn $1 billion while still competing when in 2009 he sunk $10.5 million in prize money and more than $100 million off the links, mostly through an endorsement deal with Nike. Floyd Mayweather landed the honor in 2017 after a bet on himself that removed legendary promoter Bob Arum from his corner and led to a string of self-produced pay-per-view bouts that brought in more than $25 million 12 times, including $275 million for his 2017 fight with Conor McGregor. Messi’s longtime rival Cristiano Ronaldo became the first team-sport competitor to do it when he earned $105 million during the 2019-20 season. ', '2020-08-23 08:24:01', NULL, NULL);
